import React from "react";
import VideoFooter from "./VideoFooter";
import Video from "./Video";
import "./App.css";

function App() {
  return (
    <div className="app">

      <div className="app__videos">
        <Video />
        <Video />
      </div>

      <VideoFooter />
    </div>
  );
}

export default App;
